	set	t7_data_in_area0_begin, %l4
	sub	%l3, %l4, %l3
	set	t7_data_in_area0_end, %l4	/* Calculate number of words in each area */
	set	t7_data_in_area0_begin, %l5
	sub	%l4, %l5, %l4
	srl	%l4, 2, %l4
t7_kverify_area_loop:
	sub	%l1, 4, %l1			/* Point to next area */
	sub	%l2, 4, %l2
	ld	[%l1], %o0			/* Point to start of observed area data */
	sub	%o0, %l3, %o0
	ld	[%l2], %o1			/* Point to start of expected area data */
	sub	%o1, %l3, %o1
	call	t7_kcmp				/* Compare expected/observed areas */
	mov	%l4, %o2			/* Setup count of words to verify */

	deccc	%l0				/* loop until out of areas */
	bne	t7_kverify_area_loop
	nop
#endif


        ta      T_GOOD_TRAP
        nop

			

/************************************************************************
   Routine to compare expected/observed  values
   Input:
	%o0	observed data pointer
	%o1	expected data pointer
	%o2	count of words to compare
 ************************************************************************/
#if defined(T7_KAOS_VERIFY)
t7_kcmp:
	ld	[%o0], %o3
	ld	[%o1], %o4
	cmp	%o3, %o4
	tne	BAD_TRAP
	deccc	%o2
	bne	t7_kcmp
	nop

	retl
	nop
#endif

	


.global sync_kaos_threads 

sync_kaos_threads:

        setx     sync_thread_data_start, %l1, %g1

        !
        ! Aquire sync lock
        !
1:
        ldstub  [%g1 + SYNC_LOCK_OFFSET], %g2   ! Try to get the sync_lock
        tst     %g2                             ! Is it free?
        bne     1b                              ! no, branch
        nop
	
        !
        ! Lock acquired, increment thread ready count
        !

        ld      [%g1 + SYNC_COUNT_OFFSET], %g2  ! Get the thread ready count
        inc     %g2                             ! Incement by 1
        st      %g2, [%g1 + SYNC_COUNT_OFFSET]  ! Update ready count

        !
        ! Release lock
        !
        stb     %g0, [%g1 + SYNC_LOCK_OFFSET]

        !
        ! If last thread then clear thread ready count. Otherwise spin waiting
        ! for thread ready count to be cleared
        !
        cmp     %g2, THREAD_COUNT				! last thread?
        bne     2f                              ! no, branch
        nop
        ba      3f
        st      %g0, [%g1 + SYNC_COUNT_OFFSET]  ! clear thread ready count
2:

        ld      [%g1 + SYNC_COUNT_OFFSET], %g2  ! Read thread ready count
        tst     %g2                             ! All threads here?
        bne     2b                              ! no, branch
        nop
3:
        retl                                    ! Done
        nop	
	

