!
! Shared data used to sync thread execution
!
!Module "kaos_boot_data", VA_text = 0, VA_data = T0_KAOS_STARTUP_DATA_VA
SECTION kaos_boot_data DATA_VA=T0_KAOS_STARTUP_DATA_VA
.seg "data" 
ALIGN_PAGE_8K
.global sync_thread_data_start 
sync_thread_data_start:
        .word   0                               ! lock
        .word   0                               ! ready count
